import math

def find_zero(xs: list):
    if len(xs) % 2 != 0 or len(xs) < 4:
        return None  # Cannot find zero point with less than 4 coefficients or odd number of coefficients

    a, b, c = xs[-3:] + [0, 0, 0]  # Pad with zeros if less than 3 coefficients
    if a == 0:
        return None  # Cannot find zero point if the leading coefficient is zero

    discriminant = b**2 - 4*a*c

    if discriminant < 0:
        return None  # No real roots for negative discriminant

    root1 = (-b + math.sqrt(discriminant)) / (2*a)
    root2 = (-b - math.sqrt(discriminant)) / (2*a)

    return round(root1, 10) if round(root1, 10).is_integer() else round(root2, 10)

