def do_algebra(operators, operands):
    precedence = {'**': 4, '//': 3, '*': 2, '/': 2, '+': 1, '-': 1}

    def evaluate_expression(ops, vals):
        stack = []
        i = 0
        for op, val in zip(ops, vals):
            stack.append(op)
            stack.append(val)
            i += 1
            while len(stack) > 2 and precedence[stack[-2]] <= precedence[stack[-4]]:
                op_top = stack.pop(-2)
                val2 = stack.pop()
                val1 = stack.pop()
                if op_top == '+':
                    stack.append(val1 + val2)
                elif op_top == '-':
                    stack.append(val1 - val2)
                elif op_top == '*':
                    stack.append(val1 * val2)
                elif op_top == '/':
                    stack.append(val1 / val2)
                elif op_top == '//':
                    stack.append(val1 // val2)
                elif op_top == '**':
                    stack.append(val1 ** val2)

        return stack[0]

    return evaluate_expression(operators, operands)

from heapq import heappush, heappop

def minPath(grid, k):
    def neighbors(x, y):
        for dx, dy in [(1, 0), (-1, 0), (0, 1), (0, -1)]:
            nx, ny = x + dx, y + dy
            if 0 <= nx < len(grid) and 0 <= ny < len(grid[0]):
                yield nx, ny

    heap = [(grid[i][j], [grid[i][j]], i, j) for i in range(len(grid)) for j in range(len(grid[0]))
            if len(grid) > 1 and len(grid[0]) > 1]

    while heap:
        _, path, x, y = heappop(heap)
        if len(path) == k:
            return path
        for nx, ny in neighbors(x, y):
            heappush(heap, (grid[nx][ny], path + [grid[nx][ny]], nx, ny))

