def minPath(grid, k):
    def dfs(x, y, path):
        if len(path) == k:
            return path[:]

        min_path = []
        for dx, dy in [(1, 0), (-1, 0), (0, 1), (0, -1)]:
            nx, ny = x + dx, y + dy
            if 0 <= nx < len(grid) and 0 <= ny < len(grid[0]):
                new_path = dfs(nx, ny, path + [grid[nx][ny]])
                if new_path and (not min_path or new_path < min_path):
                    min_path = new_path

        return min_path

    result = []
    for i in range(len(grid)):
        for j in range(len(grid[0])):
            new_path = dfs(i, j, [grid[i][j]])
            if new_path and (not result or new_path < result):
                result = new_path

    return result

