def do_algebra(operators, operands):
    precedence = {'+': 1, '-': 1, '*': 2, '//': 2, '**': 3}
    result_stack = []
    operator_stack = []

    for i in range(len(operators)):
        while operator_stack and precedence[operator_stack[-1]] >= precedence[operators[i]]:
            operator = operator_stack.pop()
            operand2 = result_stack.pop()
            operand1 = result_stack.pop()

            if operator == '+':
                result_stack.append(operand1 + operand2)
            elif operator == '-':
                result_stack.append(operand1 - operand2)
            elif operator == '*':
                result_stack.append(operand1 * operand2)
            elif operator == '//':
                result_stack.append(operand1 // operand2)
            elif operator == '**':
                result_stack.append(operand1 ** operand2)

        operator_stack.append(operators[i])
        result_stack.append(operands[i])

    result_stack.append(operands[-1])

    while operator_stack:
        operator = operator_stack.pop()
        operand2 = result_stack.pop()
        operand1 = result_stack.pop()

        if operator == '+':
            result_stack.append(operand1 + operand2)
        elif operator == '-':
            result_stack.append(operand1 - operand2)
        elif operator == '*':
            result_stack.append(operand1 * operand2)
        elif operator == '//':
            result_stack.append(operand1 // operand2)
        elif operator == '**':
            result_stack.append(operand1 ** operand2)

    return result_stack[0]

