        if n < 2:
            return False
        for i in range(2, int(math.sqrt(n)) + 1):
            if n % i == 0:
                return False
        return True

    prime_factors = [i for i in range(2, a) if a % i == 0 and is_prime(i)]

    if len(prime_factors) != 3:
        return False

    product = 1
    for factor in prime_factors:
        product *= factor

    return product == a

