    if isinstance(a, (int, float)) and isinstance(b, (int, float)):
        return a if a > b else b

    if isinstance(a, str) and isinstance(b, str):
        try:
            a = a.replace(',', '.')
            b = b.replace(',', '.')
            a = float(a) if '.' in a else int(a)
            b = float(b) if '.' in b else int(b)
